insert  into `articles`(`id`,`title`,`user_id`,`user_guard`,`slug`,`type`,`category_id`,`content`,`article_image`,`status`,`views`,`created_at`,`updated_at`,`deleted_at`) values (1,'Set up react app to cpanel',1,'admin','set-up-react-app-to-cpanel','service',7,'In your application\'s root directory, run yarn install to install the updated dependencies. Once this has finished, the next command you\'ll run is yarn build (npm install and npm build work, too).\n\nYou\'ll notice this creates a new directory in your project called build. The build folder is essentially a super-compressed version of your program that has everything your browser needs to identify and run your app.\n\nLet\'s head over to your hosting provider (Namecheap, Godaddy, Bluehost etc.). Once you\'ve logged in, navigate to the cPanel manager for your domain. Typically there is a dropdown menu of some kind that says \"Manage\" which will direct you to cPanel.','/tmp/phplGFtqJ',1,514,'2019-10-30 12:10:09','2019-12-28 08:49:59',NULL),(2,'Customer support',1,'admin','customer-support','service',9,'stomer support is a range of customer services to assist customers in making cost effective and correct use of a product. It includes assistance in planning, installation, training, troubleshooting, maintenance, upgrading, and disposal of a product.\n\nPhone support\nCustomers speak directly to customer support representatives over the phone. For inbound calls, an IVR (Integrated Voice Response) can be programmed to route captured calls in a variety of ways with the potential goal of quickest resolution of a customerâ€™s request/problem.\nPhone Support is often used for order taking, pre-sales queries, upselling and cross-selling, troubleshooting etc.\nOutbound calls are calls made to customers from the call center to give or take information.\nOnline chat\nWith online chat a web visitor seeks assistance, a text chat session is started by clicking on a link on the provider\'s website. The customer support representative interacts with the web visitor, understands the requirements, resolves the query and closes the interaction. Alternatively, based on the requirements the customer support representative could also trigger a chat session with the web visitor. Chat support assists with language barriers as both parties involved in the chat session may be able to use an online translation service to communicate. It is also considered less intrusive than phone support.[neutrality is disputed] Live chat support is often used for lead generation and fulfillment, campaign management, pre-sales and post-sales enquiries, complaint registration, tech support etc.\nEmail support\nEmail is the primary means to offer web-based assistance for your customers when matters do not require an immediate answer. Low-cost, non-intrusive and anywhere-anytime access are some of the advantages of email-based communications. Trouble Ticketing System and CRM Applications help keep track of a series of follow-up correspondence with a particular customer. Services offered via email response management is claims processing, polling/media analysis, subscription services, troubleshooting, complaint registrations etc.\nRemote support\nSolving problems of a computer at a particular location from a computer at another location is remote support. Companies can save considerable amounts of money on logistics through remote support. IT technicians are empowered with several tools that allow them to gain access to customersâ€™ computers at various parts of the world. They are able to gain access and repair software related problems from remote locations. The need for a technician to visit the customersâ€™ premises is mitigated. With the movement of applications from the desktop to the cloud, newer forms of browser based remote support have developed such as Cobrowsing.\nOn-site support\nOn-site support is the opposite of remote support. Certain kinds of assistance cannot be rendered remotely, like, hardware related problems. repairing a TV, replacing a spare part, servicing of air conditioners etc. In some occasions, a service provider might choose to take devices or gadgets back to their warehouse for repair.\nSocial media\nSince the arrival of social media platforms like Facebook & Twitter, service providers have found that many of their customers spend plenty of time on them daily. To make it convenient to customers, many service providers have set up a webcare team as support channel on their social media profiles. Customers are able to ask questions, register complaints, clarify doubts etc. by interacting with the companyâ€™s staff through these social media platforms. With millions of users now gaining access to social media, this platform has become as prominent as traditional media like phone, live chat and email.','/tmp/phpAh1EJ9',1,958,'2019-10-30 12:10:09','2019-12-28 08:50:10',NULL),(3,'Setup Guide Templates',1,'admin','setup-guide-templates','service',7,'If you want to create a Setup Guide in a few easy steps, then this template will tell you how to do it. This template includes sample instructions on how to setup an application, product or system, including sections on registering the software, adding troubleshooting tips and providing FAQs.\n\nThe first few pages of most Setup Guide templates include boiler.\n\nThis Setup Guide step is described in detail and is accompanied by practical tips and hints.\nYou can use this Setup Guide template to:\n\nDescribe different installation types, for example, single user or group installations\n\nIdentify the minimum system requirements\n\nHighlight pre-requisites that must be installed before the installation can start\n\nOutline the contents of the Setup packages\n\nProvide instructions on how to update, modify and repair an existing application\n\nDevelop FAQs that help customers find the answer to common queries and reduce the workload on your Technical Support Dept\n\nEncourage users to register the product','/tmp/php4RwNjE',1,399,'2019-10-18 12:10:09','2019-12-28 08:50:23',NULL),(4,'Set Up Your Very Own Web Server!',1,'admin','set-up-your-very-own-web-server','service',7,'Ever wanted to have a place where you could keep your files and access them anywhere you get an Internet connection? Say you wanted to have your music library available in case you wanted to give a song to one of your friends, or maybe you wanted to let your relatives download your entire library of vacation photos, or maybe you need a place to host programs you write or maps you make. How about a Web page? Ever wanted to have your own Web page? All of these can be accomplished with a home Web server...and more! \n\nIt\'s actually really simple to set up a Web server at home. I\'m going to use this while I\'m away at college to host game servers, have an offsite file backup, and share files with friends. Since the PC hosting the server will be at my house and I will be in my dorm room, obviously I can\'t just walk over and start changing system settings, so we\'ll need some kind of remote access. \n\nAlso, obviously, you\'ll need a dedicated PC, one you can leave running and leave connected at all times. What good is a server that goes down all the time? This PC doesn\'t have to be great, but remember, the more you run on it, the faster the PC needs to be to not lag (duh).','/tmp/phpdHGZY5',1,462,'2019-10-18 12:10:09','2019-12-28 08:50:34',NULL),(5,'Report on measurements that issue',1,'admin','report-on-measurements-that-issue','service',4,'Addition perceivability into the measurements that issue to your business. Improve execution by getting bottlenecks before they occur.','/tmp/phpegj5cA',1,380,'2019-10-18 12:10:09','2019-12-28 08:50:47',NULL),(6,'Mobile Development Tutorials',1,'admin','mobile-development-tutorials','service',1,'Android is an open source and Linux-based operating system for mobile devices such as smartphones and tablet computers. Android was developed by the Open Handset Alliance, led by Google, and other companies. This tutorial will teach you basic Android programming and will also take you through some advance concepts related to Android application develop\n\nThis tutorial has been prepared for the beginners to help them understand basic Android programming. After completing this tutorial you will find yourself at a moderate level of expertise in Android programming from where you can take yourself to next levels.\n\nAndroid programming is based on Java programming language so if you have basic understanding on Java programming then it will be a fun to learn Android application development.','/tmp/phpGNi4K2',1,679,'2019-10-18 12:10:09','2019-12-28 08:50:59',NULL),(7,'Quod corporis sit nemo et omnis dignissimos totam laboriosam perspiciatis et.',1,'admin','dolor-qui-vel-vitae','service',2,'Est eos alias odit aut. Exercitationem autem aut debitis. Nam et sint atque aut sapiente tempore et nesciunt. Rerum ea accusamus architecto et ea illo et voluptate. Dolor est suscipit nulla provident corporis. Pariatur ipsam eum laudantium aut pariatur. Facere et rerum quia in harum reprehenderit. Aut cumque non omnis. Itaque sint laboriosam reprehenderit et. Recusandae dolores fugiat animi consequatur voluptas et animi. Maxime molestias enim at aut aut. Recusandae et sunt qui quae ab. Nam dolore sed consequatur commodi. Fugit itaque accusantium totam voluptates et. Consequatur fugiat sunt mollitia officia magnam rerum rem. Odio repellendus eos omnis officia perferendis occaecati qui aut. Eum ipsam ipsum provident quo quos eum. Saepe quibusdam perspiciatis consequuntur tempore debitis natus rem. Praesentium omnis quibusdam distinctio aut ullam. Suscipit ea et natus consectetur sit est. Placeat velit quis et eligendi doloremque nostrum. Ea et officia quia sint. Debitis rerum veritatis ea sed voluptas. Numquam excepturi sed omnis ut fugiat sint. Ipsa rerum est et quidem illo quibusdam odit. Voluptatibus ut rerum nihil id voluptate. Cum exercitationem molestia